	public static boolean checkHole(){
		for(Entry<Integer, Integer> e : hashPix.entrySet()){
			if(!e.getKey().equals(1) && e.getValue().equals(0)){
				fillHole((Integer)e.getKey());
				return true;
			}		
		}
		return false;
	}
	
	public static void fillHole(int index){
		int d = 0;
		//for (int d = 1; d < depth - 1; d++) {
			for (int h = 1; h < height - 1; h++) {
				for (int w = 1; w < width - 1; w++) {
					if (mask[d * height * width + h * width + w] == index) {
						m[d * height * width + h * width + w] = checkAdjacents(w, h, d, index);
					}
				}
			}
		//}
	}
	
	public static int checkAdjacents(int w, int h, int d, int index){
		int max = 0, count = 0;
		ArrayList<Integer> adjVal = new ArrayList<Integer>();
		
			//check right
			if(mask[d * height * width + h * width + w + 1] != index)
				adjVal.add(hashPix.get(mask[d * height * width + h * width + w + 1]));

			
			//check left			
			if(mask[d * height * width + h * width + w - 1] != index)
				adjVal.add(hashPix.get(mask[d * height * width + h * width + w - 1]));
			
			//check down
			if(mask[d * height * width + (h+1) * width + w ] != index)
				adjVal.add(hashPix.get(mask[d * height * width + (h+1) * width + w]));

			//check up
			if(mask[d * height * width + (h-1) * width + w ] != index)
				adjVal.add(hashPix.get(mask[d * height * width + (h-1) * width + w ]));

			//check above
			if(d != depth - 1 && mask[(d+1) * height * width + h * width + w] != index)
				adjVal.add(hashPix.get(mask[(d+1) * height * width + h * width + w]));
			
			//check below
			if(d != 0 && mask[(d-1) * height * width + h * width + w] != index)
				adjVal.add(hashPix.get(mask[(d - 1) * height * width + h * width + w]));
			
			if(adjVal.isEmpty())
				return max;
		
			int freq = 0; int val = 0;
			for(int n = 0 ; n < adjVal.size() ; n++){
				val = adjVal.get(n);
				freq = Collections.frequency(adjVal, val);

				if(freq > count){
					max = val;
					count = freq;
				}
					
				if(freq == count && max < val){
					max = val;
					count = freq;
				}
			}

		return max;	
	}
	
	private static void recurs(int i , int j, int d, final int val, int[] x){
    	Stack<Integer> block = new Stack<Integer>();
		block.push(i);
		block.push(j);
		block.push(d);

		while(!block.isEmpty()){
			d = block.pop();
			j = block.pop();
			i = block.pop();
			
			//check right
			if(j != width - 1 && x[d * height * width + i * width + j + 1] == 0 && m[d * height * width + i * width + j + 1] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j+1);
				block.push(d);
			}

			//check left
			if(j != 0 && x[d * height * width + i * width + j - 1] == 0 && m[d * height * width + i * width + j - 1] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j-1);
				block.push(d);
			}

			//check down
			if(i != height - 1 && x[d * height * width + (i+1) * width + j ] == 0 && m[d * height * width + (i+1) * width + j] == m[d * height * width + i * width + j]){
				block.push(i+1);
				block.push(j);
				block.push(d);
			}

			//check up
			if(i != 0 && x[d * height * width + (i-1) * width + j] == 0 && m[d * height * width + (i-1) * width + j] == m[d * height * width + i * width + j]){
				block.push(i-1);
				block.push(j);
				block.push(d);
			}
			
			//check above
			if(d != depth - 1 && x[(d+1) * height * width + i * width + j] == 0 && m[(d+1) * height * width + i * width + j] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j);
				block.push(d+1);
			}
			
			//check below
			if(d != 0 && x[(d-1) * height * width + i * width + j] == 0 && m[(d-1) * height * width + i * width + j] == m[d * height * width + i * width + j]){
				block.push(i);
				block.push(j);
				block.push(d-1);
			}
			x[d * height * width + i * width + j] = val;

		}
    }
